import React from 'react'

const Navbar = () => {

  return (
    <nav class="navbar navbar-expand-lg bg-body-tertiary d-flex justify-content-between" >
        <div>Welcome</div>
        <button class="btn btn-sm btn-light mx-3">Login</button>
    </nav>
  )
}

export default Navbar
